// src/components/Dashboard.jsx

import React, { useEffect, useState } from "react";
import { Card, CardHeader, CardTitle, CardContent } from "/ui/card";
import { eventAPI } from "../services/api";
import { LineChart, Line, PieChart, Pie, Cell, BarChart, Bar, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer } from "recharts";

// ðŸŽ¨ Role colors for messages
const roleColors = {
  Concierge: "bg-blue-100 text-blue-800",
  "Performance Scientist": "bg-green-100 text-green-800",
  Nutritionist: "bg-yellow-100 text-yellow-800",
  Physiotherapist: "bg-purple-100 text-purple-800",
  "Medical Strategist": "bg-red-100 text-red-800",
  "Personal Assistant": "bg-pink-100 text-pink-800",
  Member: "bg-gray-100 text-gray-800",
};

export default function Dashboard() {
  const [profile, setProfile] = useState(null);
  const [journey, setJourney] = useState([]);
  const [metrics, setMetrics] = useState(null);

  useEffect(() => {
    eventAPI.getMemberProfile().then((res) => setProfile(res.data));
    eventAPI.getJourney().then((res) => setJourney(res.data.journey || []));
    eventAPI.getMetrics().then((res) => setMetrics(res.data));
  }, []);

  if (!profile || !journey.length || !metrics) {
    return <div className="text-center p-6 text-gray-500">Loading dashboard...</div>;
  }

  return (
    <div className="grid grid-cols-1 md:grid-cols-3 gap-6 p-6">
      {/* ðŸ§‘ Member Profile Card */}
      <Card className="col-span-1">
        <CardHeader>
          <CardTitle>Member Profile</CardTitle>
        </CardHeader>
        <CardContent>
          <p className="text-lg font-semibold">{profile.member}</p>
          <p className="text-sm text-gray-600">Active since: {profile.start_date || "N/A"}</p>
          <div className="mt-3">
            <p className="text-sm">Total Messages: {metrics.total_messages}</p>
            <p className="text-sm">Decisions Made: {metrics.total_decisions}</p>
          </div>
        </CardContent>
      </Card>

      {/* ðŸ“… Journey Timeline */}
      <Card className="col-span-2">
        <CardHeader>
          <CardTitle>Journey Timeline</CardTitle>
        </CardHeader>
        <CardContent>
          {journey.map((episode, idx) => (
            <div key={idx} className="mb-6">
              <h3 className="font-semibold text-lg text-gray-800">
                Month {episode.month}: {episode.episode}
              </h3>
              <ul className="space-y-2 mt-2">
                {episode.conversations.slice(0, 3).map((conv, i) => (
                  <li key={i} className="p-3 bg-gray-50 rounded-lg shadow-sm">
                    <span className={`px-2 py-1 rounded text-xs mr-2 ${roleColors[conv.role] || "bg-gray-200"}`}>
                      {conv.role}
                    </span>
                    <span className="font-medium">{conv.sender}:</span> {conv.message}
                    {conv.action_decision && <span className="ml-2 text-yellow-600 font-bold">âš¡ Decision</span>}
                  </li>
                ))}
              </ul>
              {episode.conversations.length > 3 && (
                <button className="mt-2 text-blue-500 text-sm hover:underline">View More</button>
              )}
            </div>
          ))}
        </CardContent>
      </Card>

      {/* ðŸ“Š Metrics & Charts */}
      <Card className="col-span-3">
        <CardHeader>
          <CardTitle>Metrics & Insights</CardTitle>
        </CardHeader>
        <CardContent className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Bar Chart */}
          <ResponsiveContainer width="100%" height={250}>
            <BarChart data={journey.map(ep => ({ name: ep.episode, messages: ep.metrics?.messages, decisions: ep.metrics?.decisions }))}>
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="messages" fill="#3b82f6" />
              <Bar dataKey="decisions" fill="#f97316" />
            </BarChart>
          </ResponsiveContainer>

          {/* Pie Chart */}
          <ResponsiveContainer width="100%" height={250}>
            <PieChart>
              <Pie
                data={metrics.role_distribution}
                dataKey="value"
                nameKey="role"
                cx="50%"
                cy="50%"
                outerRadius={80}
                label
              >
                {metrics.role_distribution.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={["#3b82f6", "#22c55e", "#eab308", "#a855f7", "#ef4444", "#ec4899", "#6b7280"][index % 7]} />
                ))}
              </Pie>
              <Tooltip />
            </PieChart>
          </ResponsiveContainer>
        </CardContent>
      </Card>
    </div>
  );
}
